(2311, '1', 'sc_admin/news/create', 'POST', '172.70.54.235', 'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36', '{\"descriptions\":{\"es\":{\"title\":\"Internet y comercio electr\\u00f3nico: relaci\\u00f3n fruct\\u00edfera y necesaria\",\"keyword\":null,\"description\":\"El\\u00a0comercio electr\\u00f3nico\\u00a0es una modalidad de compraventa que ha revolucionado el mundo empresarial y que tiene en\\u00a0Internet\\u00a0a su principal aliado.\",\"content\":\"<p>El&nbsp;<a href=\\\"https:\\/\\/www.seoptimer.com\\/es\\/blog\\/2012\\/06\\/13\\/guia-basica-para-incorporar-el-comercio-electronico-a-su-empresa-o-negocio\\/\\\" target=\\\"_blank\\\" title=\\\"Gu\\u00eda b\\u00e1sica para incorporar el comercio electr\\u00f3nico a su empresa o negocio\\\"><strong>comercio electr&oacute;nico<\\/strong><\\/a>&nbsp;es una modalidad de compraventa que ha revolucionado el mundo empresarial y que tiene en&nbsp;<a href=\\\"https:\\/\\/www.seoptimer.com\\/es\\/blog\\/2014\\/04\\/08\\/ecommerce-como-hacer-una-buena-ficha-de-producto-y-vender-en-internet\\/\\\" target=\\\"_blank\\\" title=\\\"Ecommerce: C\\u00f3mo hacer una buena ficha de producto y vender en Internet\\\"><strong>Internet<\\/strong>&nbsp;<\\/a>a su principal aliado. Sin embargo, son pocas las veces que nos paramos a analizar algunos de sus indicadores m&aacute;s importantes, as&iacute; como la manera en que &eacute;stos pueden ayudar a las organizaciones &ndash;fundamentalmente a las&nbsp;<a href=\\\"https:\\/\\/www.seoptimer.com\\/es\\/blog\\/2014\\/03\\/23\\/el-once-titularen-gestion-de-pymes\\/\\\" target=\\\"_blank\\\" title=\\\"El `once titular\\u00b4en gesti\\u00f3n de pymes\\\"><strong>pymes<\\/strong><\\/a>&ndash; a desarrollar sus negocios digitalmente.<\\/p>\\r\\n\\r\\n<p>Por este motivo, y coincidiendo con la semana de celebraci&oacute;n del&nbsp;<strong>D&iacute;a de Internet<\\/strong>&nbsp;que tiene lugar el 17 de mayo- queremos mostraros algunos datos significativos sobre la&nbsp;<strong>relaci&oacute;n entre&nbsp;<a title=\\\"Los efectos de las redes sociales en el ecommerce [fusion_builder_container hundred_percent=\\\" yes=\\\"\\\">Internet y comercio electr&oacute;nico<\\/a><\\/strong>, para que os resulten &uacute;tiles a la hora de mejorar vuestros resultados.<\\/p>\\r\\n\\r\\n<p>2.-&nbsp;<b>Razones por las que decantarse por el comercio online<\\/b>. Los motivos por los que los consumidores se decantan por esta modelo de negocio frente al tradicional son la comodidad, las ofertas y precios de los art&iacute;culos y el ahorro de tiempo que les genera dicha opini&oacute;n (78%; 73% y 65% respectivamente).<\\/p>\\r\\n\\r\\n<p>3.-&nbsp;<b>Clientes nacionales, comercios nacionales<\\/b>. En 2014, el 80% de los consumidores que utilizamos el comercio digital optamos por comprar productos de empresas espa&ntilde;olas. Frente a este dato, el 36% adquiri&oacute; en pa&iacute;ses de la UE y el 21% del resto del mundo.<\\/p>\\r\\n\\r\\n<p>4.-&nbsp;<b>Perfil definido<\\/b>. Las f&eacute;minas son potencialmente m&aacute;s compradoras que los hombres a nivel online. De hecho, en el caso espa&ntilde;ol los datos devuelven que el a&ntilde;o pasado tres de cada diez realizaron alguna compra en la red. Del mismo modo, los estratos de edad que mayores operaciones registran son los comprendidos entre los 35 y los 44 a&ntilde;os (29%) y los j&oacute;venes entre 25 y 34 a&ntilde;os (28%).<\\/p>\"}},\"alias\":null,\"image\":\"\\/data\\/content\\/blog-5.jpg\",\"sort\":\"1\",\"_token\":\"KxHug9RE4jpMHIU8i49Yk899kNOmRnSNUFbAojdV\"}', '2022-09-09 09:23:00', '2022-09-09 09:23:00'),
