INSERT INTO `sc_shop_news_description` (`news_id`, `lang`, `title`, `keyword`, `description`, `content`) VALUES
('97387c1e-f1f3-4fa2-8cd5-2d125d0126f8', 'en', 'pronto abriremos nuestras puertas', 'pronto abriremos nuestras puertas', 'pronto abriremos nuestras puertas', 'pronto abriremos nuestras puertas'),
('97387c1e-f1f3-4fa2-8cd5-2d125d0126f8', 'es', 'pronto abriremos nuestras puertas', 'Inaguracion', '- ¡Ya falta menos! Muy pronto abriremos nuestras puertas, os avisaremos por aquí. Mientras tanto ... ¡Sigamos las normas de seguridad!', '<big>- &iexcl;Ya falta menos! Muy pronto abriremos nuestras puertas, os avisaremos por aqu&iacute;. Mientras tanto ... &iexcl;Sigamos las normas de seguridad!</big>'),
('97388351-de77-41f3-a9ed-45926ef46b1e', 'es', '¿POR QUÉ ELEGIRNOS?', NULL, 'Consideramos que poseer y respetar una metodología ordenada de desarrollo es la garantía de lograr el éxito en todos nuestros proyectos.', 'Nos apasiona la tecnolog&iacute;a. Inv<span style=\"font-family:Arial,Helvetica,sans-serif;\"></span>ertimos tiempo constantemente en investigar la<img alt=\"\" src=\"/data/content/cup.jpeg\" style=\"float: right; width: 229px; height: 220px;\" />s tendencias de mercado internacional y aplicarlas en los diferentes proyectos en los que participamos.<br />\r\n<br />\r\nFormamos un equipo con nuestros clientes por eso el &eacute;xito de ellos es nuestra propia medida de &eacute;xito. Procuramos identificar las necesidades de nuestros clientes y ofrecer soluciones integrales de valor agregado.'),
('973885c2-8854-4bbd-b52e-89d6480ead44', 'es', 'Internet y comercio electrónico: relación fructífera y necesaria', NULL, 'El comercio electrónico es una modalidad de compraventa que ha revolucionado el mundo empresarial y que tiene en Internet a su principal aliado.', '<p>El&nbsp;<a href=\"https://www.seoptimer.com/es/blog/2012/06/13/guia-basica-para-incorporar-el-comercio-electronico-a-su-empresa-o-negocio/\" target=\"_blank\" title=\"Guía básica para incorporar el comercio electrónico a su empresa o negocio\"><strong>comercio electr&oacute;nico</strong></a>&nbsp;es una modalidad de compraventa que ha revolucionado el mundo empresarial y que tiene en&nbsp;<a href=\"https://www.seoptimer.com/es/blog/2014/04/08/ecommerce-como-hacer-una-buena-ficha-de-producto-y-vender-en-internet/\" target=\"_blank\" title=\"Ecommerce: Cómo hacer una buena ficha de producto y vender en Internet\"><strong>Internet</strong>&nbsp;</a>a su principal aliado. Sin embargo, son pocas las veces que nos paramos a analizar algunos de sus indicadores m&aacute;s importantes, as&iacute; como la manera en que &eacute;stos pueden ayudar a las organizaciones &ndash;fundamentalmente a las&nbsp;<a href=\"https://www.seoptimer.com/es/blog/2014/03/23/el-once-titularen-gestion-de-pymes/\" target=\"_blank\" title=\"El `once titular´en gestión de pymes\"><strong>pymes</strong></a>&ndash; a desarrollar sus negocios digitalmente.</p>\r\n\r\n<p>Por este motivo, y coincidiendo con la semana de celebraci&oacute;n del&nbsp;<strong>D&iacute;a de Internet</strong>&nbsp;que tiene lugar el 17 de mayo- queremos mostraros algunos datos significativos sobre la&nbsp;<strong>relaci&oacute;n entre&nbsp;<a title=\"Los efectos de las redes sociales en el ecommerce [fusion_builder_container hundred_percent=\" yes=\"\">Internet y comercio electr&oacute;nico</a></strong>, para que os resulten &uacute;tiles a la hora de mejorar vuestros resultados.</p>\r\n\r\n<p>2.-&nbsp;<b>Razones por las que decantarse por el comercio online</b>. Los motivos por los que los consumidores se decantan por esta modelo de negocio frente al tradicional son la comodidad, las ofertas y precios de los art&iacute;culos y el ahorro de tiempo que les genera dicha opini&oacute;n (78%; 73% y 65% respectivamente).</p>\r\n\r\n<p>3.-&nbsp;<b>Clientes nacionales, comercios nacionales</b>. En 2014, el 80% de los consumidores que utilizamos el comercio digital optamos por comprar productos de empresas espa&ntilde;olas. Frente a este dato, el 36% adquiri&oacute; en pa&iacute;ses de la UE y el 21% del resto del mundo.</p>\r\n\r\n<p>4.-&nbsp;<b>Perfil definido</b>. Las f&eacute;minas son potencialmente m&aacute;s compradoras que los hombres a nivel online. De hecho, en el caso espa&ntilde;ol los datos devuelven que el a&ntilde;o pasado tres de cada diez realizaron alguna compra en la red. Del mismo modo, los estratos de edad que mayores operaciones registran son los comprendidos entre los 35 y los 44 a&ntilde;os (29%) y los j&oacute;venes entre 25 y 34 a&ntilde;os (28%).</p>');
