('9768182d-0f8e-4e0e-84a9-2e28ef796d3d', 'es', 'INFINIX ZERO X NEO', 'INFINIX', 'INFINIX ZERO X NEO', '<strong><em>Caracteristicas</em>&nbsp;y especificaciones ; - octa-core (2x2.05 GHz Cortex-A76 &amp; 6x2.0 GHz Cortex-A55) ; Procesador de gr&aacute;ficos (GPU), Mali-G76 MC4 ; Tarjeta de memoria&nbsp;...<br />\r\nFecha de lanzamiento:&nbsp;2021, Septiembre 13<br />\r\nDimensiones (AlxAnxProf):&nbsp;168.4 Х 76.5 Х 8.8...<br />\r\nColores:&nbsp;Nebula Black, Starry Silver, Bahamas ...<br />\r\nBater&iacute;a:&nbsp;5000 mAh, Li-Po, no extra&iacute;ble</strong>'),
('97681c16-9e75-472f-a23b-842d11d44e29', 'es', 'TECNO SPARK 8C', 'TECNO', 'TECNO SPARK 8C', '<strong>Dimensiones: 164.6 x 76 x 9 mm.</strong><br />\r\n<strong>Pantalla t&aacute;ctil: IPS LCD.</strong><br />\r\n<strong>Tama&ntilde;o: 6.6 &laquo;</strong><br />\r\n<strong>Resoluci&oacute;n: 720 x 1612 px.</strong><br />\r\n<strong>SO: Android 11, HiOS 7.6.</strong><br />\r\n<strong>Procesador: Unisoc Tiger T606. Octa core.</strong><br />\r\n<strong>Memoria Interna: 2/64 GB.</strong><br />\r\n<strong>C&aacute;mara trasera: Doble. 13 MP + QVGA. Dual-LED lash, HDR, panorama.</strong>'),
