('97682a96-add9-48ba-b6c1-43f1cbffae0f', 'es', 'SMART TV 43 ANDROID', 'TELEVISOR', 'TELEVISOR 43&quot; FHD SMART ANDROID', '<span style=\"font-size:14px;\"><strong>Sintonizador digital.</strong></span><br />\r\n<span style=\"font-size:14px;\"><strong>Procesador: ARM Cortex A53/1.<br />\r\n6GHz/Quad core.</strong></span><span style=\"font-size:14px;\"><strong>Resolucion: 1920&times;1080.</strong></span><span style=\"font-size:14px;\"><strong>Color: Negro.</strong></span><br />\r\n<span style=\"font-size:14px;\"><strong>Control remoto.</strong></span><span style=\"font-size:14px;\"><strong>Sistema Operativo :&nbsp;Android&nbsp;6.0.</strong></span>');
